import CharDetailCard from './characterDetail';
import { Grid } from '@material-ui/core';
const characters = ({ data }) => {
   return (
      <Grid container spacing={3}>
         {
            data.map(items => {
               // console.log(items);
               <Grid item xs={3}>
                  {
                     <CharDetailCard items={items} />
                  }
               </Grid>

            })
         }
      </Grid>
   )
}

export default characters;
